var tipuesearch = {"pages":[{"title":"Changelog","text":"  All notable changes to this project will be documented in this file.  The format is based on Keep a Changelog, and this project adheres to Semantic Versioning.  [Unreleased]   lorem   [N.N.N] - YYYY-MM-DD  Added   lorem   Changed   lorem   Deprecated   lorem   Removed   lorem   Fixed   lorem   Security   lorem  ","tags":"","url":"CHANGELOG.html"},{"title":"Time Machine Ignore","text":"    Summary  Easily ignore a project's files and folders from Time Machine backups using a YAML config.  Visit https:\/\/aklump.github.io\/tm_ignore for full documentation.  Quick Start   Install in your repository root using cloudy pm-install aklump\/tm_ignore Open bin\/config\/tm_ignore.yml and add all the paths you wish to be ignored by Time Machine. Apply your changes to TM with .\/bin\/tm_ignore Use .\/bin\/tm_ignore help for other featurs.   Requirements  You must have Cloudy installed on your system to install this package.  Installation  The installation script above will generate the following structure where . is your repository root.  . \u251c\u2500\u2500 bin \u2502\u00a0\u00a0 \u251c\u2500\u2500 tm_ignore -&gt; ..\/opt\/tm_ignore\/tm_ignore.sh \u2502\u00a0\u00a0 \u2514\u2500\u2500 config \u2502\u00a0\u00a0     \u251c\u2500\u2500 tm_ignore.yml \u251c\u2500\u2500 opt \u2502   \u251c\u2500\u2500 cloudy \u2502   \u2514\u2500\u2500 aklump \u2502       \u2514\u2500\u2500 tm_ignore \u2514\u2500\u2500 {public web root}   To Update   Update to the latest version from your repo root: cloudy pm-update aklump\/tm_ignore   Configuration Files  Refer to the file(s) for documentation about configuration options.       Filename   Description   VCS       tm_ignore.yml   Configuration shared across all server environments: prod, staging, dev   yes     Usage   To see all commands use .\/bin\/tm_ignore help   Under the Hood   This package uses the built in tmutil utility.  This controls Time Machine via the CLI.  For example to exclude any system path use tmutil addexclusion &lt;path&gt;. The undo the exclusion, use tmutil removeexclusion &lt;path&gt;.   Contributing  If you find this project useful... please consider making a donation.  Credits   Inspiration and code was taken from Asimov, thank you Steve.  ","tags":"","url":"README.html"},{"title":"Search Results","text":" ","tags":"","url":"search--results.html"}]};
